import React from "react";
import "./about.css";

function About() {
  return (
    <div className="about-container">
      <p className="about-body">
        I'm a Software Engineering graduate who recently graduated from{" "}
        <span>Swinburne University of Technology </span>
        eager to join a software development team as a graduate developer to
        extend and improve my knowledge in software development, contribute my
        skills and enthusiasm within a team environment and experience what is
        like to work in a team of developers.
      </p>
    </div>
  );
}

export default About;
